import { useEffect } from "react"

export default function Statistics() {

    const getMaxReadCount = () => {
        fetch("/admin/maxReadCount")
        .then(res => res.json())
        .then(data => {
            console.log(data);
        })
    }

    useEffect(() => {
        getMaxReadCount();

    },[]);

    return (
        <div>
            <h2>가장 조회수 많은 게시글</h2>
            <h2>가장 좋아요 많은 게시글</h2>
            <h2>가장 댓글 많은 게시글</h2>
        </div>
    )
}
